import React, { useState, useEffect } from 'react';
import { TrendingUp, TrendingDown, Clock, Activity, Target, Award } from 'lucide-react';

const PostureHistory = ({ detectionHistory }) => {
  const [sessionStats, setSessionStats] = useState({
    startTime: new Date(),
    totalGood: 0,
    totalBad: 0,
    currentStreak: 0,
    bestStreak: 0,
    lastStatus: 'unknown'
  });

  useEffect(() => {
    if (detectionHistory.length === 0) return;

    const latest = detectionHistory[detectionHistory.length - 1];

    setSessionStats(prev => {
      const isGood = latest.status === 'good';
      const newStreak = isGood && prev.lastStatus === 'good' 
        ? prev.currentStreak + 1 
        : isGood ? 1 : 0;

      return {
        ...prev,
        totalGood: prev.totalGood + (isGood ? 1 : 0),
        totalBad: prev.totalBad + (isGood ? 0 : 1),
        currentStreak: newStreak,
        bestStreak: Math.max(prev.bestStreak, newStreak),
        lastStatus: latest.status
      };
    });
  }, [detectionHistory]);

  const getPostureScore = () => {
    const total = sessionStats.totalGood + sessionStats.totalBad;
    if (total === 0) return 0;
    return Math.round((sessionStats.totalGood / total) * 100);
  };

  const getScoreColor = (score) => {
    if (score >= 80) return 'text-posture-good';
    if (score >= 60) return 'text-yellow-400';
    return 'text-posture-bad';
  };

  const getScoreLabel = (score) => {
    if (score >= 90) return 'Excellent!';
    if (score >= 80) return 'Great';
    if (score >= 70) return 'Good';
    if (score >= 60) return 'Fair';
    if (score >= 50) return 'Needs Work';
    return 'Poor';
  };

  const formatDuration = () => {
    const now = new Date();
    const diff = Math.floor((now - sessionStats.startTime) / 1000);
    const minutes = Math.floor(diff / 60);
    const seconds = diff % 60;
    return `${minutes}:${seconds.toString().padStart(2, '0')}`;
  };

  const [duration, setDuration] = useState('0:00');

  useEffect(() => {
    const interval = setInterval(() => {
      setDuration(formatDuration());
    }, 1000);
    return () => clearInterval(interval);
  }, [sessionStats.startTime]);

  const score = getPostureScore();

  return (
    <div className="space-y-6">
      {/* Posture Score Card */}
      <div className="glass-panel p-6 text-center">
        <h3 className="text-sm font-medium text-white/60 mb-2">Session Posture Score</h3>
        <div className="relative inline-flex items-center justify-center">
          <svg className="w-32 h-32 transform -rotate-90">
            <circle
              cx="64"
              cy="64"
              r="56"
              stroke="currentColor"
              strokeWidth="8"
              fill="none"
              className="text-dark-600"
            />
            <circle
              cx="64"
              cy="64"
              r="56"
              stroke="currentColor"
              strokeWidth="8"
              fill="none"
              strokeDasharray={`${score * 3.52} 352`}
              strokeLinecap="round"
              className={`${score >= 70 ? 'text-posture-good' : score >= 50 ? 'text-yellow-400' : 'text-posture-bad'} transition-all duration-500`}
            />
          </svg>
          <div className="absolute inset-0 flex flex-col items-center justify-center">
            <span className={`text-3xl font-bold ${getScoreColor(score)}`}>{score}%</span>
            <span className="text-xs text-white/50">{getScoreLabel(score)}</span>
          </div>
        </div>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-2 gap-4">
        <div className="glass-panel p-4">
          <div className="flex items-center gap-2 mb-2">
            <Clock className="w-4 h-4 text-white/60" />
            <span className="text-sm text-white/60">Session Time</span>
          </div>
          <p className="text-2xl font-bold text-white">{duration}</p>
        </div>

        <div className="glass-panel p-4">
          <div className="flex items-center gap-2 mb-2">
            <Activity className="w-4 h-4 text-white/60" />
            <span className="text-sm text-white/60">Total Checks</span>
          </div>
          <p className="text-2xl font-bold text-white">
            {sessionStats.totalGood + sessionStats.totalBad}
          </p>
        </div>

        <div className="glass-panel p-4">
          <div className="flex items-center gap-2 mb-2">
            <Target className="w-4 h-4 text-posture-good" />
            <span className="text-sm text-white/60">Current Streak</span>
          </div>
          <p className="text-2xl font-bold text-posture-good">{sessionStats.currentStreak}</p>
        </div>

        <div className="glass-panel p-4">
          <div className="flex items-center gap-2 mb-2">
            <Award className="w-4 h-4 text-yellow-400" />
            <span className="text-sm text-white/60">Best Streak</span>
          </div>
          <p className="text-2xl font-bold text-yellow-400">{sessionStats.bestStreak}</p>
        </div>
      </div>

      {/* Good vs Bad Breakdown */}
      <div className="glass-panel p-4">
        <h4 className="text-sm font-medium text-white/60 mb-4">Posture Breakdown</h4>
        <div className="space-y-3">
          <div>
            <div className="flex items-center justify-between mb-1">
              <div className="flex items-center gap-2">
                <TrendingUp className="w-4 h-4 text-posture-good" />
                <span className="text-sm text-white">Good Posture</span>
              </div>
              <span className="text-sm font-semibold text-posture-good">{sessionStats.totalGood}</span>
            </div>
            <div className="h-2 bg-dark-600 rounded-full overflow-hidden">
              <div 
                className="h-full bg-posture-good rounded-full transition-all duration-300"
                style={{ width: `${score}%` }}
              />
            </div>
          </div>

          <div>
            <div className="flex items-center justify-between mb-1">
              <div className="flex items-center gap-2">
                <TrendingDown className="w-4 h-4 text-posture-bad" />
                <span className="text-sm text-white">Bad Posture</span>
              </div>
              <span className="text-sm font-semibold text-posture-bad">{sessionStats.totalBad}</span>
            </div>
            <div className="h-2 bg-dark-600 rounded-full overflow-hidden">
              <div 
                className="h-full bg-posture-bad rounded-full transition-all duration-300"
                style={{ width: `${100 - score}%` }}
              />
            </div>
          </div>
        </div>
      </div>

      {/* Recent History */}
      {detectionHistory.length > 0 && (
        <div className="glass-panel p-4">
          <h4 className="text-sm font-medium text-white/60 mb-3">Recent Detections</h4>
          <div className="flex gap-1 flex-wrap">
            {detectionHistory.slice(-50).map((detection, index) => (
              <div
                key={index}
                className={`w-2 h-6 rounded-sm transition-all ${
                  detection.status === 'good' 
                    ? 'bg-posture-good' 
                    : detection.status === 'bad'
                      ? 'bg-posture-bad'
                      : 'bg-white/20'
                }`}
                title={`${detection.status} - ${new Date(detection.timestamp).toLocaleTimeString()}`}
              />
            ))}
          </div>
          <p className="text-xs text-white/40 mt-2">Last 50 detections</p>
        </div>
      )}
    </div>
  );
};

export default PostureHistory;
